INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (0.0, 24, 10021, 4, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 0.0, 24015, 1, 4, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (4.0, 24, 10021, 1, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 0.0, 24016, 2, 4, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (0.0, 24, 10021, 4, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "マジムンだらけで目が回るさ～！\nふらふらさ～！", 0.0, 24017, 3, 4, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (5.2, 24, 10021, 2, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 0.0, 24018, 4, 1, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (4.2, 24, 10021, 6, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 0.0, 24019, 5, 5, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (0.0, 24, 10021, 2, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 0.0, 24020, 6, 2, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (6.4, 24, 10021, 6, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 0.0, 24021, 7, 1, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (0.0, 24, 10021, 2, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 0.0, 24022, 8, 2, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (10.08, 24, 10021, 3, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 0.0, 24023, 9, 6, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (5.0, 24, 10021, 2, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 0.0, 24024, 10, 1, 0.0);
INSERT INTO `v1_8aea57b8284ed551ccd813befea2ddc534956c8fbec3991590ac01ef7cf8bfe8` VALUES (0.0, 24, 10021, 2, "2030/12/17 14:59:59", 110501, "2019/07/31 12:00:00", "カオリ（サマー）", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 0.0, 24025, 11, 2, 0.0);
